import React from 'react';
import './App.css';
import styled from 'styled-components';

export default class App extends React.Component{
  render(){
    return (<React.Fragment>
      <Wrapper>
        <WrapperButton>
          <div>
            <input type="text" placeholder="Enter Name"/>
            <input type="text" placeholder="Enter Name"/>
          </div>
          <button>Add</button>
        </WrapperButton>
      </Wrapper>
    </React.Fragment>);
  }
}

const Wrapper = styled.div`
  margin: 25px auto 0px;
  padding:10px;
  position: relative;
  background: #a8dadc;
  background-color: #a8dadc;
  width: 650px;
  border-radius: 4px;
`;
const WrapperButton = styled.div`
  position: relative;
  display: flex;
  background: #ef476f;
  background-color:  #ef476f;
  height: 30px;
  > *{
    flex: 3;
    height: 100% !important;
  }
  > button{
    flex: 1;
    height: 100%;
  }
  > div >  input{
    padding-left: 10px;
    border: none;
    // margin: 0;
    // padding: 0;
    outline: none;
    background: #ef476f;
    font-size: 0.9rem;
    color: #fff;
    font-weight: bold;
  }
  > div {
    border: none;
    display: flex;
    > * {
      flex: 1;
    }
  }
  > div > input::placeholder{
    color: #fff;
  }
`;
